import React, { Component } from 'react'

class BMICalculator extends Component {
  render() {
    return (
      <div id="divContainer">
        <div id="divHead">BMI Calculator</div>
        <div id="divInputs">
            <select><option>--Select units of height and weight--</option><option>kg-metres</option><option>lbs-inches</option></select>
            <div><label>Enter weight</label><input type="number" id="inputHeight"/></div>
            <div><label>Enter height</label><input type="number" id="inputWeight"/></div>
        </div>
        <div id="divResult">
            <p>18.4</p>
            <p>Underweight</p>
        </div>
      </div>
    )
  }
}

export default BMICalculator
